  position: relative;
  width: 100vw;
  height: 100vh;
}
#pp-002 main #imageContainer #image {
  width: 100vw;
  height: 100vh;
}
#pp-002 main #imageContainer #overlayCanvas {
  z-index: 1;
  position: absolute;
  top: 0;
  left: 0;
}
#pp-002 main #imageContainer #overlayLayer {
  z-index: 2;
  display: flex;
  flex-flow: row wrap;
  position: absolute;
  top: 0;
  left: 0;
  width: 100vw;
  pointer-events: none;
}
#pp-002 main #imageContainer #overlayLayer .part {
  width: 20px;
  height: 20px;
}
#pp-002 main #imageContainer #overlayLayer .block {
  display: flex;
  flex-flow: row wrap;
  width: 20px;
  height: 20px;
}
#pp-002 main #imageContainer #overlayLayer .block li {
  width: 10px;
  height: 10px;
}

@media (max-width: 900px) {
  #pp-002 {
    overflow: hidden;
  }
}
#pp-004 main #wrap {
  display: flex;
  flex-flow: row nowrap;
  width: 100%;
}
#pp-004 main #wrap #no-fold {
  position: relative;
  width: 25%;
  height: 300px;
  background: #FFF;
}
#pp-004 main #wrap .fold {
  position: relative;
  width: 0;
  height: 300px;
  background: #000;
  transition: 1s ease;
}
#pp-004 main #wrap .fold.show {
  width: 25%;
}
#pp-004 main #wrap #no-fold img,
#pp-004 main #wrap .fold img {
  width: 100%;
  height: 100%;
}
#pp-004 main #wrap .shadow {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  opacity: 0.2;
}

