  padding: 3px 3px 0 0;
  border: solid 1px #000;
  font-family: serif;
  font-style: italic;
  font-size: 28px;
}

#p-006 input {
  display: flex;
  width: 100%;
  height: 32px;
  padding: 0 6px;
  margin-bottom: 8px;
  border: solid 1px #000;
  border-radius: 2px;
}
#p-006 input:focus {
  padding: 0 5px;
  border: solid 2px blue;
  color: blue;
}
#p-006 ul.input-radio-wrap {
  display: flex;
  flex-flow: row nowrap;
  align-items: center;
  justify-content: center;
}
#p-006 ul.input-radio-wrap li {
  display: flex;
  flex-flow: row nowrap;
  align-items: center;
  justify-content: center;
  margin: 0 8px;
}
#p-006 ul.input-radio-wrap li input[type=radio] {
  width: 18px;
  padding: 0;
  margin: 0 4px 0 0;
}
#p-006 ul.input-radio-wrap li label {
  padding-bottom: 3px;
  margin: 0;
}
#p-006 ul.input-checkbox-wrap {
  display: flex;
  flex-flow: row nowrap;
  align-items: center;
  justify-content: center;
}
#p-006 ul.input-checkbox-wrap li {
  display: flex;
  flex-flow: row nowrap;
  align-items: center;
  justify-content: center;
  margin: 0 8px;
}
#p-006 ul.input-checkbox-wrap li input[type=checkbox] {
  width: 16px;
  padding: 0;
  margin: 0 4px 0 0;
}
#p-006 ul.input-checkbox-wrap li label {
  padding-bottom: 3px;
  margin: 0;
}
#p-006 textarea {
  display: block;
  width: 100%;
  padding: 5px;
  margin-bottom: 8px;
  border: solid 1px #000;
  border-radius: 2px;
  resize: none;
}
#p-006 textarea:focus {
  padding: 4px;
  border: solid 2px blue;
  color: blue;
}
#p-006 select {
  display: block;
  width: 100%;
  height: 32px;
  margin-bottom: 8px;
  border: solid 1px #000;
  border-radius: 2px;
}
#p-006 button {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 100px;
  height: 30px;
  padding-bottom: 3px;
  margin: 12px auto 0 auto;
  border: solid 1px #000;
  border-radius: 4px;
  font-size: 16px;
}
#p-006 button:hover {
  background: #EEE;
}
#p-006 button:active {
  background: #CCC;
}
#p-006 #input {
  padding: 16px;
  margin: 36px 0;
  border: dashed 1px #000;
  border-radius: 2px;
}
#p-006 #output {
  padding: 16px;
  border: dashed 1px #000;
  border-radius: 2px;
}

#p-007 #header {
  z-index: 90;
  position: fixed;
  top: 0;
  left: 0;
  width: 100%;
  height: 20px;
  background: orange;
  transition: transform 0.3s ease-in-out;
}
#p-007 #header.hidden {
  transform: translateY(-100%);
}
#p-007 #blank {
  width: 100%;
  height: 2000px;
}

#p-009 .wrap {
  display: inline-block;
  position: relative;
  padding: 1px 0;
}
#p-009 .wrap .textarea {
  display: block;
  position: relative;
  width: 200px;
  height: 180px;
  padding: 1px 6px;
  margin: 0;
  resize: none;
  font-size: 14px;
}
#p-009 .wrap .nav {
  display: none;
  position: absolute;
  top: -32px;
  left: 0;
  width: auto;
  height: 32px;
  background: #EAEAEA;
}
#p-009 .wrap .nav input[type=number] {
  display: block;
  width: 50px;
  height: 100%;
  padding: 4px;
  margin: 0;
}
#p-009 .wrap .nav button.close {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 22px;
  height: calc(100% - 10px);
  padding: 0 0 2px 0;
  margin: 5px;
  color: #FFF;
  background: #000;
  border: solid 1px #000;
  border-radius: 3px;
}
#p-009 .wrap.over {
  padding: 0;
}
#p-009 .wrap.over .textarea {
  resize: both;
  border-top: dashed 1px #000;
  border-bottom: dashed 1px #000;
}
#p-009 .wrap.over .nav {
  display: flex;
  flex-flow: row nowrap;
}

#pp-001 main {
  position: relative;
  width: 100vw;
  margin: 0;
  padding: 0;
}
#pp-001 main section {
  display: flex;
  flex-flow: column nowrap;
  width: 100vw;
}
#pp-001 main #front {
  position: absolute;
  top: 0;
  left: 0;
}
#pp-001 main #front .part {
  display: flex;
  align-items: center;
  justify-content: center;
  width: 65vw;
  height: 65vw;
  margin: 0 auto;
  background: grey;
  border-bottom: solid 1px #000;
}
#pp-001 main #front .part#hook-front {
  background: black;
}
#pp-001 main #back .part {
  width: 100vw;
  height: 100vw;
  background: green;
  border-bottom: solid 1px #000;
}
#pp-001 main #back .part#hook-back {
  background: black;
}

#pp-002 {
  background: #222;
}
#pp-002 main {
  position: relative;
  width: 100vw;
  max-width: 100vw;
  height: 100vh;
  padding: 0;
  margin: 0;
}
#pp-002 main #imageContainer {
  position: relative;
  width: 100vw;
  height: 100vh;
}
#pp-002 main #imageContainer #image {
  width: 100vw;
  height: 100vh;
}
#pp-002 main #imageContainer #overlayCanvas {
  z-index: 1;
  position: absolute;
  top: 0;
  left: 0;
}
#pp-002 main #imageContainer #overlayLayer {
  z-index: 2;
  display: flex;
  flex-flow: row wrap;
  position: absolute;
  top: 0;
  left: 0;
  width: 100vw;
  pointer-events: none;
}
#pp-002 main #imageContainer #overlayLayer .part {
  width: 20px;
  height: 20px;
}
#pp-002 main #imageContainer #overlayLayer .block {
  display: flex;
  flex-flow: row wrap;
  width: 20px;
  height: 20px;
}
#pp-002 main #imageContainer #overlayLayer .block li {
  width: 10px;
  height: 10px;
}

@media (max-width: 900px) {
  #pp-002 {
    overflow: hidden;
  }
}
#pp-004 main #wrap {
  display: flex;
  flex-flow: row nowrap;
  width: 100%;
}
#pp-004 main #wrap #no-fold {
  position: relative;
  width: 25%;
  height: 300px;
  background: #FFF;
}
#pp-004 main #wrap .fold {
  position: relative;
  width: 0;
  height: 300px;
  background: #000;
  transition: 1s ease;
}
#pp-004 main #wrap .fold.show {
  width: 25%;
}
#pp-004 main #wrap #no-fold img,
#pp-004 main #wrap .fold img {
  width: 100%;
  height: 100%;
}
#pp-004 main #wrap .shadow {
  position: absolute;
  top: 0;
  left: 0;
  width: 100%;
  height: 100%;
  opacity: 0.2;
}
